  `KOs` varchar(10) DEFAULT NULL COMMENT '케이오확률',
  `status` varchar(10) DEFAULT NULL COMMENT '상태',
  `born` varchar(20) DEFAULT NULL COMMENT '생년월일',
  `nationality` varchar(50) DEFAULT NULL COMMENT '소속나라',
