  `commission` varchar(20) DEFAULT NULL COMMENT '소속단체',
  `fsttm` datetime DEFAULT NULL COMMENT '최초작성날짜',
  `lsttm` datetime DEFAULT NULL COMMENT '업데이트날짜'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

